<script>
    $('.slider-galeria').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        fade: true,
        asNavFor: '.slider-galeria-thumbs',
    });
    $('.slider-galeria-thumbs').slick({
        slidesToShow: 4,
        slidesToScroll: 1,
        vertical: true,
        asNavFor: '.slider-galeria',
        dots: false,
        focusOnSelect: true,
        verticalSwiping: true,
    });
    // nếu ảnh > 3 thì mới hiển thị nút prev next
    if ($('.slider-galeria-thumbs .slick-slide').length > 3) {
        $('.prevButton').show();
        $('.nextButton').show();
    } else {
        $('.prevButton').hide();
        $('.nextButton').hide();
    }
    $('.prevButton').click(function() {
        $('.slider-galeria-thumbs').slick('slickPrev');
    });
    $('.nextButton').click(function() {
        $('.slider-galeria-thumbs').slick('slickNext');
    });
    $(document).ready(function() {
        if ($('input[type="radio"]').is(':checked')) {
            $('input[type="radio"]:checked').next().addClass('active');
        }
        $('input[type="radio"]').change(function() {
            if ($(this).is(':checked')) {
                $(this).next().addClass('active');
                $(this).parent().siblings().find('label').removeClass('active');
            }
        });
    });
</script>